import React, { Component, Fragment } from "react";
import {
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle
} from "@material-ui/core";
import { DH_UNABLE_TO_CHECK_GENERATOR } from "constants";

class NewUser extends Component {
  constructor(props) {
    super(props);

    this.state = {
      openDialog: false
    };

    this.validateUser = this.validateUser.bind(this);
    this.clearValidationErrors = this.clearValidationErrors.bind(this);
    this.validateUser = this.validateUser.bind(this);
  }

  handleClickOpen = () => {
    if (this.validateUser() === true) {
      return (
        <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="alert-dialog-title"
          aria-describedby="alert-dialog-description"
        >
          <DialogTitle id="alert-dialog-title">
            {"Registration Succesfull"}
          </DialogTitle>
          <DialogContent>
            <DialogContentText id="alert-dialog-description">
              Thank you for joining us at S4A. Providing the tools you need to
              succeed.
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <Button onClick={this.handleClose} color="primary">
              Continue
            </Button>
          </DialogActions>
        </Dialog>
      );
    } else {
      console.log("not valid");
    }
  };

  handleClose = () => {
    this.setState({ openDialog: false });
  };

  clearValidationErrors(element) {
    let newArr = [];
    for (let error of this.props.prevState.errors) {
      if (element !== error.element) {
        newArr.push(error);
      }
    }
    return { errors: newArr };
  }

  validateUser() {
    const username = this.props.parentState.username;
    console.log(username);
    let registrationValid = true;
    if (username === "") {
      this.props.onSubmit("username", "Username cannot be empty!");

      registrationValid = false;
    }
    return registrationValid;
  }

  render() {
    return (
      <Fragment>
        <Button
          variant="contained"
          color="primary"
          type="submit"
          onClick={this.handleClickOpen}
        >
          Register
        </Button>
      </Fragment>
    );
  }
}

export default NewUser;

